import React from "react";
import ListItem from "./list-item";

const TodoList = ({todos}) => {

    const elementsTodos = todos.map((item) =>  {
        return (
            <li><ListItem
                label={item.label}
                important={item.important} />
            </li>
        );
    })

    return (
        <ul>
            {elementsTodos}
        </ul>
    );
}

export default TodoList;
